import React from 'react'
import TarjetasVista from './TarjetasVista';

const AreasVista = ({changeView, posts}) => {
    
    let paramsProm = new Promise((resolve, reject) => {
        resolve(
            changeView({
            collection: "areas",
            filter: {}
            })
        )
    })
    paramsProm.then(res => {
        console.log("res:", res)
        return (
            <div className="AreasVista">
                <TarjetasVista tarjetas={res} />
            </div>
        );
    })
    
    
}

export default AreasVista
